import SlickSlider from "../../slickSlider/SlickSlider";
import Card from "./Common_page/homeLayout/Card";
const Home = () => {
  return (
    <>
      <Page name="Home Page !" />
      <SlickSlider />
      <Card />
      <div className=" container">
        <img src="https://picsum.photos/200/305" class="img-fluid" alt="d" />
      </div>
    </>
  );
};

export default Home;
